import React, { Component } from 'react'
import {Button, Container, Image } from 'semantic-ui-react'



export class NavBar extends Component {
    render() {
        return (

                <div className="image">
                    <Container>
                <Button fluid attached="top">Login</Button>
                <Image fluid src='https://images.unsplash.com/photo-1457369804613-52c61a468e7d?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&w=1000&q=80' alt="books" />
                    <h1><span>Welcome to Book Finder</span></h1>
                    </Container>
                </div>

        )
    }
}

export default NavBar
